syntax = "proto3";

package sdc.biceps;

option java_multiple_files = true;
option java_package = "org.somda.sdc.proto.model.biceps";
option java_outer_classname = "PatientTypeProto";


message PatientTypeMsg {
  enum EnumType {
    UNSPEC = 0;
    AD = 1;
    ADO = 2;
    PED = 3;
    INF = 4;
    NEO = 5;
    OTH = 6;
  }
  EnumType enum_value = 1;
}
